//import logo from './logo.svg';
import './App.css';
import Background from './componentes/Banner/Background';

function App() {
  return (
    <div className="App">

      <header className="App-header">
      <div style={{ backgroundImage: "url(/background.jpeg)" }}>
  Hello World
</div>


        <a className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
